ice - User Cleanup'),(40,'FOG_SERVICE_GREENFOG_ENABLED','This setting defines if the green fog module should be enabled.  The green fog module will shutdown or restart a computer at a set time.  (Valid values are 0 or 1)','1','FOG Service - Green Fog'),(41,'FOG_SERVICE_AUTOLOGOFF_ENABLED','This setting defines if the auto log off module should be enabled.  This module will log off any active user after X minutes of inactivity.  (Valid values are 0 or 1)','1','FOG Service - Auto Log Off'),(42,'FOG_SERVICE_DISPLAYMANAGER_ENABLED','This setting defines if the fog display manager should be active.  The fog display manager will reset the clients screen resolution to a fixed size on log off and on computer start up.  (Valid values are 0 or 1)','','FOG Service - Display Manager'),(43,'FOG_SERVICE_DISPLAYMANAGER_X','This setting defines the default width in pixels to reset the computer display to with the fog display manager service.','1024','FOG Service - Display Manager'),(44,'FOG_SERVICE_DISPLAYMANAGER_Y','This setting defines the default height in pixels to reset the computer display to with the fog display manager service.','768','FOG Service - Display Manager'),(45,'FOG_SERVICE_DISPLAYMANAGER_R','This setting defines the default refresh rate to reset the computer display to with the fog display manager service.','60','FOG Service - Display Manager'),(46,'FOG_SERVICE_AUTOLOGOFF_MIN','This setting defines the number of minutes to wait before logging a user off of a PC. (Value of 0 will disable this module.)','0','FOG Service - Auto Log Off'),(47,'FOG_SERVICE_AUTOLOGOFF_BGIMAGE','This setting defines the location of the background image used in the auto log off module.  The image should be 300px x 300px.  This image can be located locally (such as c:\\images\\myimage.jpg) or on a web server (such as http://freeghost.sf.net/images/image.jpg)','c:\\program files\\fog\\images\\alo-bg.jpg','FOG Service - Auto Log Off'),(48,'FOG_KEYMAP','This setting defines the keymap used on the client boot image.','','General Settings'),(49,'FOG_SERVICE_HOSTNAMECHANGER_ENABLED','This setting defines if the fog hostname changer should be globally active.  (Valid values are 0 or 1)','1','FOG Service - Hostname Changer'),(50,'FOG_SERVICE_SNAPIN_ENABLED','This setting defines if the fog snapin installer should be globally active.  (Valid values are 0 or 1)','1','FOG Service - Snapins'),(51,'FOG_KERNEL_ARGS','This setting allows you to add additional kernel arguments to the client boot image.  This setting is global for all hosts.','','General Settings'),(52,'FOG_SERVICE_CLIENTUPDATER_ENABLED','This setting defines if the fog client updater should be globally active.  (Valid values are 0 or 1)','1','FOG Service - Client Updater'),(53,'FOG_SERVICE_HOSTREGISTER_ENABLED','This setting defines if the fog host register should be globally active.  (Valid values are 0 or 1)','1','FOG Service - Host Register'),(54,'FOG_SERVICE_PRINTERMANAGER_ENABLED','This setting defines if the fog printer maanger should be globally active.  (Valid values are 0 or 1)','1','FOG Service - Printer Manager'),(55,'FOG_SERVICE_TASKREBOOT_ENABLED','This setting defines if the fog task reboot should be globally active.  (Valid values are 0 or 1)','1','FOG Service - Task Reboot'),(56,'FOG_SERVICE_USERTRACKER_ENABLED','This setting defines if the fog user tracker should be globally active.  (Valid values are 0 or 1)','1','FOG Service - User Tracker'),(57,'FOG_AD_DEFAULT_DOMAINNAME','This setting defines the default value to populate the host\'s Active Directory domain name value.','','Active Directory Defaults'),(58,'FOG_AD_DEFAULT_OU','This setting defines the default value to populate the host\'s Active Directory OU value.','','Active Directory Defaults'),(59,'FOG_AD_DEFAULT_USER','This setting defines the default value to populate the host\'s Active Directory user name value.','','Active Directory Defaults'),(60,'FOG_AD_DEFAULT_PASSWORD','This setting defines the default value to populate the host\'s Active Directory password value.  This settings must be encrypted.','','Active Directory Defaults'),(61,'FOG_UTIL_DIR','This setting defines the location of the fog utility directory.','/opt/fog/utils','FOG Utils'),(62,'FOG_PLUGINSYS_ENABLED','This setting defines if the fog plugin system should be enabled.','','Plugin System'),(63,'FOG_PLUGINSYS_DIR','This setting defines the base location of fog plugins.','./plugins','Plugin System'),(69,'FOG_PXE_MENU_TIMEOUT','This setting defines the default value for the pxe menu timeout.','3','FOG Boot Settings'),(70,'FOG_PROXY_IP','This setting defines the proxy ip address to use.','','Proxy Settings'),(71,'FOG_PROXY_PORT','This setting defines the proxy port address to use.','','Proxy Settings'),(72,'FOG_UTIL_BASE','This setting defines the location of util base, which is typically /opt/fog/','/opt/fog/','FOG Utils'),(73,'FOG_PXE_MENU_HIDDEN','This setting defines if you would like the FOG pxe menu hidden or displayed','','FOG Boot Settings'),(74,'FOG_PXE_ADVANCED','This setting defines if you would like to append any settings to the end of your PXE default file.',':MENU\r\nmenu\r\nitem win81e\r\n:win81e\r\nkernel memdisk iso raw\r\ninitrd win81e.iso\r\ngoto MENU ||\r\nautoboot','FOG Boot Settings'),(75,'FOG_USE_LEGACY_TASKLIST','This setting defines if you would like to use the legacy active tasks window.  Note:  The legacy screen will no longer be updated.','','General Settings'),(76,'FOG_QUICKREG_AUTOPOP','Enable FOG Quick Registration auto population feature (0 = disabled, 1=enabled).  If this feature is enabled, FOG will auto populate the host settings and automatically image the computer without any user intervention.','','FOG Quick Registration'),(77,'FOG_QUICKREG_IMG_ID','FOG Quick Registration Image ID.','-1','FOG Quick Registration'),(78,'FOG_QUICKREG_OS_ID','FOG Quick Registration OS ID.','','FOG Quick Registration'),(79,'FOG_QUICKREG_SYS_NAME','FOG Quick Registration system name template.  Use * f