ice.  (1 = enabled, 0 = disabled).','1','General Settings'),(89,'FOG_PIGZ_COMP','PIGZ Compression Rating','1','FOG Boot Settings'),(90,'FOG_KEY_SEQUENCE','Key Sequence for boot prompt.','','FOG Boot Settings'),(91,'FOG_LEGACY_FLAG_IN_GUI','This setting allows you to set whether or not an image is legacy.  Valid values are 0 or 1','1','General Settings'),(92,'FOG_PROXY_USERNAME','This setting defines the proxy username to use.','','Proxy Settings'),(93,'FOG_PROXY_PASSWORD','This setting defines the proxy password to use.','','Proxy Settings'),(94,'FOG_NO_MENU','This setting sets the system to no menu, if there is no task set, it boots to first device.','','FOG Boot Settings'),(102,'FOG_MINING_PACKAGE_PATH','Where should we pull the donation script from?','http://fogproject.org/fogpackage.zip','Donations'),(95,'FOG_TFTP_PXE_KERNEL_32','Location of the 32 bit kernel file on the PXE server, this should point to the kernel itself.','bzImage32','TFTP Server'),(96,'FOG_PXE_BOOT_IMAGE_32','The settings defines where the 32 bit fog boot file system image is located.','init_32.xz','TFTP Server'),(97,'FOG_MINING_ENABLE','This setting defines whether to have the imaging client give up a resources for mining cryptocurrency.  This is a means to donate to the FOG project without any real money.','1','Donations'),(98,'FOG_BOOT_EXIT_TYPE','The method of booting to the hard drive.  Most will accept sanboot, but some require exit.','sanboot','FOG Boot Settings'),(99,'FOG_MINING_MAX_CORES','This setting defines the maximum number of CPU cores you are willing to dedicate to mining cryptocurrency.','1','Donations'),(100,'FOG_MINING_FULL_RESTART_HOUR','This setting define the hour of the day, in 24 hour format, for when you would like the donation task to reboot.','6','Donations'),(101,'FOG_MINING_FULL_RUN_ON_WEEKEND','If set to 1, then FOG_MINING_FULL_RESTART_HOUR is ignored over weekends.','1','Donations');
