INSERT INTO `modules` VALUES (1,'Directory Cleaner','dircleanup','This setting will enable or disable the directory cleaner service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(2,'User Cleanup','usercleanup','This setting will enable or disable the user cleaner service module on this specific host.  If the module is globally disabled, this setting is ignored.  The user clean up service will remove all stale users on the local machine, accept for user accounts that are whitelisted.  This is typically used when dynamic local users is implemented on the workstation.'),(3,'Display Manager','displaymanager','This setting will enable or disable the display manager service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(4,'Auto Log Out','autologout','This setting will enable or disable the auto log out service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(5,'Green FOG','greenfog','This setting will enable or disable the green fog service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(6,'Snapins','snapin','This setting will enable or disable the snapin service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(7,'Client Updater','clientupdater','This setting will enable or disable the client updater service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(8,'Host Registration','hostregister','This setting will enable or disable the host register service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(9,'Hostname Changer','hostnamechanger','This setting will enable or disable the hostname changer module on this specific host.  If the module is globally disabled, this setting is ignored.'),(10,'Printer Manager','printermanager','This setting will enable or disable the printer manager service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(11,'Task Reboot','taskreboot','This setting will enable or disable the task reboot service module on this specific host.  If the module is globally disabled, this setting is ignored.'),(12,'User Tracker','usertracker','This setting will enable or disable the user tracker service module on this specific host.  If the module is globally disabled, this setting is ignored.');
/*!40000 ALTER TABLE `modules` ENABLE KEYS */;
